// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.FormulaTemplate) predicate.FormulaTemplate {
	return predicate.FormulaTemplate(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.FormulaTemplate) predicate.FormulaTemplate {
	return predicate.FormulaTemplate(sql.NotPredicates(p))
}
